import React, {Component} from 'react';
import { Grid, Cell } from 'react-mdl';


class LandingPage extends Component {
    render() {
        return (
            <div style={{width: '100%', margin: 'auto'}}>
            <Grid className= "landing-grid">
                <Cell col={12}></Cell>
                <img className="avatar-img" alt="avatar-img" src="https://images.vexels.com/media/users/3/145908/preview2/52eabf633ca6414e60a7677b0b917d92-male-avatar-maker.jpg" />
                <div className="banner-text">
                    <h1> Full Stack Web Developer</h1>
                    <p>HTML/CSS | Bootstrap | JavaScript | React | Python | NodeJS | MySQL</p>
                    <div className="social-links"></div>
                    {/* LinkedIn Profile */}
                    <a href="www.google.com" target="_blank" rel="nooppener noreferrer">
                    <i className="fa fa-linkedin-square"  aria-hidden="true"/></a>
                    {/* Github Profile */}
                    <a href="www.google.com" target="_blank" rel="nooppener noreferrer">
                    <i className="fa fa-github-square"  aria-hidden="true"/></a>
                    {/* Facebook Profile */}
                    <a href="www.google.com" target="_blank" rel="nooppener noreferrer">
                    <i className="fa fa-facebook-square"  aria-hidden="true"/></a>
                </div>

            </Grid>
            </div>
        );

    }
}

export default LandingPage;
